import './App.css';
import React, {useState} from 'react';
import axios from 'axios'

import Filter from './components/Filter'

function App() {

  const [ autocomplete, setAutocomplete ] = useState([])



  const handleNewSearch = (event) => {

    const searchName = event.target.value.toLowerCase();

    if (searchName === '') {
      return;
    }
    else {


      console.log(searchName);

      axios
        .get(`http://localhost:3001/autocomplete/${searchName}`)
        .then(response => {

          const data = response.data.predictions

          const predictions = []

          for (let term of data) {
            console.log(term.description);
            predictions.push(term.description)
          }
          console.log(predictions);
          setAutocomplete(predictions)

        })
        .catch(error => {
          console.log(error);
        })
    }



  }

  return (
    <div>
      <h3></h3>

      <Filter handleNewSearch={handleNewSearch}/>

      {autocomplete.map(term => {
        <li>{term}</li>
      })}

    </div>
  );
}

export default App;
